package com.sample.basicmvvmarchitecturesample.mockgenerator

import com.sample.basicmvvmarchitecturesample.data.models.Movie
import java.util.*

/**
 * Mock class to generate mock data
 */
open class MockGenerator {
    companion object {
        private val RANDOM = Random()

        private val images = arrayOf(
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,"
        )

        private fun getMovieName(): String {
            val name = arrayOf(
                "Avenger End Game",
                "Avenger End Game",
                "Avenger Infinity War",
                "Batmen The Dark nigh rise",
                "Inception",
                "Gravity",
                "Mission Impossible",
                "Spidermen Home coming",
                "The Wolverine",
                "John Wick"
            )
            return name[RANDOM.nextInt(name.size)]
        }

        private val rating = arrayOf("9", "8.8", "7", "8.9", "9.5", "8.3", "6.6")
        private val description =
            arrayOf("The Marvel Cinematic Universe is an American media franchise and shared universe centered on a series of superhero films, independently produced by Marvel Studios and based on characters that appear in American comic books published by Marvel Comics")

        private fun getMovie(): Movie {
            val movie = Movie()
            movie.name = getMovieName()
            movie.image = images[RANDOM.nextInt(images.size)]
            movie.description = description[0]
            movie.rating = rating[RANDOM.nextInt(rating.size)]
            return movie
        }

        fun getMovies(): MutableList<Movie> {
            val movies = mutableListOf<Movie>()
            for (index in 0 until 20) {
                movies.add(getMovie())
            }
            return movies
        }
    }
}